import React, { Component } from 'react';

class Comments extends Component {
    constructor(props) {
        super(props);
    }

    RenderComments(comments_array) {
        comments_array.every(function (comment) {
            if (this.props.dish_comment != null) {
                console.log(comment);
                return (
                    <p>{comment}</p>
                );
            }
            else {
                return (
                    <div></div>
                );
            }
        });
    }


    render() {
        if (this.props.dish_comment != null) {
            return (
                this.RenderComments(this.props.dish_comment.comments)
            );
        } else {
            return (
                <div></div>
            );
        }
    }
}

export default Comments;
